import SideBar from "../SideBar/sideBar"

function telaDeposito(){
    return(
        <div>
            <SideBar/>
            <div className="saldo-card">
                <p>Depósito realizado com sucesso!</p> 
            </div>
        </div>
    )
}

export default telaDeposito
